webpackJsonp([0xe02bcbcf75e8],{8117:function(e,o){e.exports={data:{post:{html:'<p>The coupon for <a href="http://www.papascott.de/archives/2009/09/20/easy-morning-for-free-goes-nationwide/">tomorrow\'s free breakfast on election day</a> just went online today. They are good at all McDonald\'s nationwide, but only tomorrow from 9 to 11 am, so you have to be quick! Print out the <a href="http://www.mcdonalds-nordheide.de/wordpress/wp-content/uploads/2009/09/mcdonalds_wahlfruehstueck.pdf">PDF</a> and you won\'t have to buy a newspaper!</p>\n<p><a href="http://www.mcdonalds-nordheide.de/wordpress/wp-content/uploads/2009/09/mcdonalds_wahlfruehstueck.pdf"><img src="http://www.mcdonalds-nordheide.de/wordpress/wp-content/uploads/2009/09/mcdonalds_wahlfruehst.00001.jpg" alt="mcdonalds_wahlfruehst.00001.jpg" border="0" width="450" height="159" /></a></p>',fields:{title:"Easy Morning for Free: The Coupon",date:"26 Sep 2009",url:"https://papascott.de/2009-09-26-easy-morning-for-free-the-coupon/"}}},pathContext:{slug:"/2009-09-26-easy-morning-for-free-the-coupon/",prev:{fields:{title:"My New Favorite Oktoberfest Quote",date:"23 Sep 2009",slug:"/2009-09-23-my-new-favorite-oktoberfest-quote/"}},next:{fields:{title:"Barely, Slightly...",date:"29 Sep 2009",slug:"/2009-09-29-barely-slightly/"}}}}}});
